    body,
    html {
      height: 100%;
      margin: 0;
      padding: 0
    }

    #loader-wrapper {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 999999;
      background: #f0f0f0
    }

    #loader-logo {
      display: block;
      position: relative;
      left: 50%;
      top: 30%;
      height: 32px;
      width: 152px;
      margin: -76px 0 0 -76px
    }

    .sk-chase {
      display: block;
      position: relative;
      left: 50%;
      top: 50%;
      width: 72px;
      height: 72px;
      margin: -36px 0 0 -36px;
      animation: sk-chase 2.5s infinite linear both
    }

    .sk-chase-dot {
      width: 100%;
      height: 100%;
      position: absolute;
      left: 0;
      top: 0;
      animation: sk-chase-dot 2s infinite cubic-bezier(.455, .03, .515, .955) both
    }

    .sk-chase-dot:before {
      content: '';
      display: block;
      width: 25%;
      height: 25%;
      background-color: #333;
      border-radius: 100%;
      animation: sk-chase-dot-before 2s infinite cubic-bezier(.455, .03, .515, .955) both
    }

    .sk-chase-dot:nth-child(1) {
      animation-delay: -1.1s
    }

    .sk-chase-dot:nth-child(2) {
      animation-delay: -1s
    }

    .sk-chase-dot:nth-child(3) {
      animation-delay: -.9s
    }

    .sk-chase-dot:nth-child(4) {
      animation-delay: -.8s
    }

    .sk-chase-dot:nth-child(5) {
      animation-delay: -.7s
    }

    .sk-chase-dot:nth-child(6) {
      animation-delay: -.6s
    }

    .sk-chase-dot:nth-child(1):before {
      animation-delay: -1.1s
    }

    .sk-chase-dot:nth-child(2):before {
      animation-delay: -1s
    }

    .sk-chase-dot:nth-child(3):before {
      animation-delay: -.9s
    }

    .sk-chase-dot:nth-child(4):before {
      animation-delay: -.8s
    }

    .sk-chase-dot:nth-child(5):before {
      animation-delay: -.7s
    }

    .sk-chase-dot:nth-child(6):before {
      animation-delay: -.6s
    }

    @keyframes sk-chase {
      100% {
        transform: rotate(360deg)
      }
    }

    @keyframes sk-chase-dot {

      100%,
      80% {
        transform: rotate(360deg)
      }
    }

    @keyframes sk-chase-dot-before {
      50% {
        transform: scale(.4)
      }

      100% {
        transform: scale(1)
      }
    }
